import React from 'react';
import Button from '../../stled/Button';

const Search = () => {
	const handler = (path) => {
		console.log(`${path} is where your going`);
	};
	return (
		<Button
			onclick={() => {
				handler(path);
			}}>
			Search
		</Button>
	);
};

export default Search;
